  \"2013-03-14T19:22:18.605127\",\n\t\"name\": \"offshore-surficial-sediment\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data layer (PAC_EXT.txt and PAC_PRS.txt)
  represents two of five point coverages of known sediment samples, inspections, and
  probes from the usSEABED data collection for the U.S. Pacific continental margin
  integrated using the software system dbSEABED. This data layer represents the extracted
  (EXT) and the parsed (PRS) output of the dbSEABED mining software. EXT contains
  data items which were extracted from the data resources files and generally represent
  lab-based analytical data. The EXT data are usually considered the most rigorous
  data available, although some data may represent a subsample of the sediment (that
  is, large shells or stones may have been excluded from the analysis). PRS contains
  the numeric results parsed from text-based descriptions held in the data resource
  files (DRF). Because it relies on descriptions, the PRS data are less precise than
  the extracted data (EXT), but may include information on outsized elements and consolidation
  that are often not in lab-analyzed data.\",\n\t\"license_title\": null,\n\t\"extras\":
